import AppLayout from '../components/AppLayout';
import Head from 'next/head';

const Signup = () => {
    return 
    <>
    <Head>
            <title>NodeSNS</title>
            <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/antd/3.26.7/antd.css" />
        </Head>

    <AppLayout>
    <div>
        회원가입
    </div>
    </AppLayout>
    </>
};

export default Signup;
